import React, { Component } from 'react';
import logo from '../logo.svg';
import '../css/App.css';
import axios from 'axios';

class App extends Component {
    proxy_url = "https://cors-anywhere.herokuapp.com/";

    constructor (props) {
        super(props)

        //this.request = this.request.bind(this)
        this.state = {
            arrived: false
        };
    };


    componentDidMount() {

        let url = 'http://localhost:8080/greeting'
        let testurl = 'http://localhost:8080/test'

        let getConfig = {
            headers: {

            },
            params: {
                name: 'Mihaela'
            }
        }
        axios.get(url, getConfig)
            .then(response => {
                console.log(response)
                this.setState({arrived:true})
            })
            .catch(() => console.log("Can’t access " + url + " response. Blocked by browser?"))

        let postData = {
            text: "ce faci",
            mesaj: "salut",
            intul: 3
        }

        let postConfig = {

        }

        axios.post(testurl, postData, postConfig)
            .then(response => {
                console.log(response)
            })
            .catch(() => {
                console.log("Can't access " + testurl)
            })
    }

    render() {

        if (!this.state.arrived) {
            return (
                <div className="App">
                    <header className="App-header">
                        <img src={logo} className="App-logo" alt="logo"/>
                        <p>
                            Edit <code>src/App.js</code> and save to reload.
                        </p>
                        <a
                            className="App-link"
                            href="https://reactjs.org"
                            target="_blank"
                            rel="noopener noreferrer"
                        >
                            Learn React
                        </a>
                    </header>
                </div>

            );
        } else {
            return (
                <div className="App">
                    <header className="App-header">
                        <img src={logo} className="App-logo" alt="logo"/>
                        <p>
                            A ajuns raspunsul de la server :D
                        </p>
                        <a
                            className="App-link"
                            href="https://reactjs.org"
                            target="_blank"
                            rel="noopener noreferrer"
                        >
                            Learn React
                        </a>
                    </header>
                </div>

            );
        }
  }
}

export default App;
